import { View, Text,StyleSheet,FlatList } from 'react-native'
import React from 'react'

 const Example=()=> {
    const futsalData=[
        {id:1,name:"Ankit Dhakal" ,position:"FIXO"},
        {id:2,name:"Nikhil Thapa" ,position:"FIXO"},
        {id:3,name:"Rabin Thapa" ,position:"ALA"},
        {id:4,name:"Seth Pariyar" ,position:"PIVOT"},
        {id:5,name:"Alexis Subedi" ,position:"GK"},
        {id:6,name:"Dabeeg Rana" ,position:"ALA"},
        {id:7,name:"Bishal Budhathoki" ,position:"ALA"},
        {id:8,name:"Sushant Thapa" ,position:"FIXO"},


    ]
  return (
    <View>
    <FlatList
    // style={styles.listStyle}
    keyExtractor={(index)=> {  //external key extractor
        return index.id
}}
    data={futsalData}
    renderItem={({item})=>{
        return <Text >{item.name}</Text>
    }}
    />


    </View>
  )
}

const styles = StyleSheet.create({
    listStyle:{
        textAlign:"center",
        backgroundColor:"voilet",
        padding:5

    },

    textStyle:{
        color:"white",
        padding:5,
        fontSize:30,
        margin:20,


    },
});

export default Example;
